import React from 'react'

import styled from 'styled-components'

const Real = styled.img(props => ({
  position: 'absolute',
}))

const Vector = styled.img(props => ({
  background: props.theme.primary,
  position: 'relative',
  top: 0,
  left: 0,
  transition: 'opacity .5s ease',

  '&:hover': {
    opacity: 0
  }
}))

const picStyles = {
  width: '250px',
  height: '250px',
  border: 'none',
  outline: 'none',
  borderRadius: '50%',
  display: 'block'
}


export default function TwoFace (props) {

  togglePic = () => {
    alert('toggled')
  }

  return (
    <div className={props.className}>
      <Real style={picStyles} src={require('./real.png')} onClick={togglePic}/>
      <Vector style={picStyles} src={require('./vec-t.png')} onClick={togglePic}/>
    </div>
  )
}
